import image from '../assets/logo.png'
import '../styles/Sous_Banner.css'

function Sous_Banner() {
    return (
        <div className='sous-banner'>
            <img src={image} alt='Kasa' className='sous-banner-logo' />
            <nav className='navs-banner'>
                <p className='nav-banner'>Accueil</p>
            </nav>
        </div>
    )
}

export default Sous_Banner
